Text=сђђсѓфсЃгсЂ» сѓйсЃІсЃЃсѓ»№╝Ђ сѓйсЃІсЃЃсѓ»сЃ╗сѓХсЃ╗сЃўсЃЃсѓИ\nсЃЏсЃЃсѓ░№╝Ђ\nсђђсЂфсѓЊсЂдсЂЊсЂ*сЂЪсђЂсѓесЃЪсЃ╝сЂїсЂёсЂфсЂё№╝Ђ сЂЙсЂЋсЂІ\nсЂісЂёсЂІсЂЉсЂдсЂЇсЂЪсѓесЃЃсѓ░сЃъсЃ*сЂ«сЃГсЃюсЃЃсЃѕсЂФ \n'ЇЋсЂЙсЂ*сЂЪсѓЊсЂўсѓЃсЂфсЂёсЂасѓЇсЂєсЂф№╝Ъ\nсђђсѓесЃЪсЃ╝сЂ» сѓёсЂ*сЂ▒сѓі сЃѕсЃЕсЃќсЃФсЃАсЃ╝сѓФсЃ╝сђѓ\nсЂЌсЂІсЂЌсђЂ'ћЙсЂ*сЂдсЂісЂЈсѓЈсЂЉсЂФсѓѓсЂёсЂІсЂфсЂёсЂюсђѓ\n\nсђђсѓесЃЪсЃ╝№╝Ђ сЂЕсЂЊсЂФУАїсЂ*сЂАсЂЙсЂ*сЂЪсѓЊсЂа№╝Ъ\n'јбсЂЏсѓІта┤'ЅђсЂ» сЂЈсЂЙсЂфсЂЈ'јбсЂЮсЂєсЂю№╝Ђ
